import React from "react";
import "./App.css";
import Body from "./components/Body";
import Header from "./components/Header";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Header
          title="こんにちは世界！"
          number={5}
          myFunc={(a, b) => a + b}
          myArr={[100, 200, 300]}
          myObj={{
            a: 13,
            b: "To jest b"
          }}
        />
        <Body
          myFunc={(a, b) => a + b}
          text="Learn React NOW!"
          text2="なんとかかんとか"
        />
        <Body myFunc={(a, b) => a + b} text="Co ja robię tu?" text2="何？" />
      </div>
    );
  }
}

export default App;
